import { StatusBar } from 'expo-status-bar';
import React, { Component } from 'react';
import { StyleSheet, Text, View, Image, TouchableWithoutFeedback, TextInput, SafeAreaView, keyboard, TouchableOpacity, KeyboardAvoidingView } from 'react-native';
import Login from './component/Login';
export default function App() {
  return (
    <View style={styles.container}>
      <Login/>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#000220',
    flexDirection: 'column',
  },
  logoContainer: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
  logo:{
    width: 200,
    height: 76,
  },
  title:{
    color: 'white',
    fontSize: 20,
    textAlign: 'center',
    marginTop: 15,
    opacity: 0.9,
  },
  infoContainer:{
    position: 'absolute',
    left: 0,
    right: 0,
    bottom: 0,
    height: 200,
    padding: 20,
  },
  input: {
    borderRadius: 25,
    backgroundColor: 'white',
    color: 'black',
    marginBottom:10,
    paddingHorizontal: 15,
    paddingVertical: 10
  },
  buttonContainer:{
    backgroundColor: '#3C99DC',
    paddingVertical: 15,
    borderRadius: 25,
  },
  buttonText:{
    textAlign: 'center',
    color: 'blue',
    fontSize: 18,
    fontWeight: 'bold',
  }
});
